import styled from "styled-components";

const MyPageComp = styled.div`
  width: 100%;
  height: 100vh;
  .mypage_inner {
    width: 1100px;
    height: 100%;
    margin: 0 auto;
    background-color: green;
  }
`;
export default MyPageComp;
